import React from 'react';
import MenuItem from '../menu-items/menu-items.componenta';
import '../directory/directory.style.css'



class Directory extends React.Component{
    constructor () {
  super();
 
  this.state = {
      sections :[
          {title: 'HATS',
          imageUrl : '../../images/hats/3' ,
          id:ha1},
      
          {title: 'JACKETS',

          imageUrl : <img src="../../images/jackets/3" alt="JACKETS" />,
          id:j1},

         {title: ' SNEAKERS',
         imageUrl :<img src="../../images/shoes/2" alt="SHOES" />,
         id:3},
         
         {title: 'MEN',
          imageUrl : <img src="../../images/models/1" alt="MENS" />,
          size:'large',
          id:4},
         
         {title: 'WOMEN',
         imageUrl :  <img src="../../images/models/4" alt="MENS"/>,
         size:'large',
         id:5}
        ] 
       }

 }
 render(){
     return(
        <div className ='directory-menu'>
            {
                this.state.sections.map(({title,imageUrl,id,size}) => (
                <MenuItem key={id} title={title} imageUrl={imageUrl} size ={size}/>
            
            ))}
        </div>
     )
 }

}
export default Directory;
